response:
\boxed{720} 

Pentru rezolvare, considerăm grupul format din cei 3 prieteni ca un singur „bloc”. Astfel, avem blocul respectiv plus ceilalți 5 indivizi, deci 6 entităţi. Deoarece aranjamentele la masa circulară sunt considerate identice dacă se obţine prin rotaţie, numărul de aranjamente este (6 – 1)! = 5! = 120. În plus, cei 3 indivizi din bloc se pot așeza în 3! = 6 moduri. 

Înmulţind cele două rezultate, obţinem: 120 × 6 = 720 moduri.
